import logo from './logo.svg';
import './App.css';
import { Timeline } from './Timeline/Timeline'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={'Colorway=2-Color Black alt'} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <Timeline/>
    </div>
  );
}

export default App;
